    "2016-05-31T01:08:28.222838",nt"name": "afsc-race-gap-conrath-rockfish-habitat-and-productivity-coral",nt"isopen":
    false,nt"url": null,nt"notes": "The importance of high relief structure
    containing biotic habitat to rockfish and other species remains largely unknown.
    This data set was created to examine the importance of this habitat for Pacific
    ocean perch, northern rockfish, and dusky rockfish. These data were derived from
    four research cruises that occurred between May 2012 and December 2014. During the
    cruises, video data was recorded of habitat associations, plankton samples were
    collected, temperature profiles were recorded, and several types of biological samples
    were taken from trawl captured rockfish. These data will be recorded in several
    tables in an access database and video files will also be available.",nt"license_title":
